import React from 'react';
import { useDispatch } from 'react-redux';
import { getUniqueWords } from '../../../actions/words';

const WordsToCheckContainer = () => {
  const dispatch = useDispatch();

  const handleClick = () => { dispatch(getUniqueWords()); }

  return (
    <div>
      <textarea className="form-control">
        Words to check
     </textarea>
     <button className="mt-4 btn btn-primary" onClick={handleClick}>Search Words</button>
    </div>

  )
}

export default WordsToCheckContainer;
